tps://demo.madrasthemes.com/electro-visualcomposer/wp-content/uploads/sites/50/2020/11/footer-wdiget-banner.png',0,'attachment','image/png',0),(5345,1,'2022-12-14 22:43:48','2022-12-14 22:43:48','','images','','inherit','open','closed','','images','','','2022-12-14 22:43:48','2022-12-14 22:43:48','',2933,'http://myymalucca.com.br/wp-content/uploads/2016/03/images.jpg',0,'attachment','image/jpeg',0),(5346,1,'2022-12-14 22:52:44','2022-12-14 22:52:44','<img class=\"alignnone wp-image-2994 size-large\" src=\"https://demo.madrasthemes.com/demo-2/wp-content/uploads/sites/50/2018/10/electro-description-placeholder-3.png\" alt=\"overview_hero_2x\" width=\"1024\" height=\"430\" />\r\n\r\nA groundbreaking Retina display. Powerful dual-core and quad-core Intel processors. Fast flash storage. High-performance graphics. Great built-in apps. And now in the 13-inch model, a revolutionary new Force Touch trackpad and even longer battery life.1 Whatever you can imagine, MacBook Pro with Retina display gives you the power to create.\r\n\r\nThe design of MacBook Pro packs a lot of power into not a lot of space. Because we believe that high performance shouldnt come at the expense of portability. And despite being so compact, the new 13-inch and 15-inch MacBook Pro with Retina display models now deliver up to 10 hours and nine hours of battery life, respectively  an hour more than the previous models.\r\n\r\n<img class=\"alignnone wp-image-2993 size-full\" src=\"https://demo.madrasthemes.com/demo-2/wp-content/uploads/sites/50/2018/10/electro-description-placeholder-3.png\" alt=\"hero_large_2x\" width=\"1956\" height=\"724\" />\r\n\r\nWith Multi-Touch in OS X, you can use realistic gestures like swiping or pinching to switch between apps, navigate your content and get the most out of your desktop space.\r\n\r\nThe new Force Touch trackpad takes all the capabilities of Multi-Touch and adds force sensors that detect subtle differences in the amount of downward pressure you apply. This lets you have a deeper connection to your content, bringing more functionality to your fingertip. It also introduces haptic feedback to MacBook Pro  allowing you to not just see whats happening on the screen, but to feel it.','Notebook Black Spire V Nitro  VN7-591G','<ul>\r\n 	<li>4.5 inch HD Screen</li>\r\n 	<li>Android 4.4 KitKat OS</li>\r\n 	<li>1.4 GHz Quad Core Processor</li>\r\n 	<li>20 MP front Camera</li>\r\n</ul>','inherit','closed','closed','','2933-autosave-v1','','','2022-12-14 22:52:44','2022-12-14 22:52:44','',2933,'https://myymalucca.com.br/?p=5346',0,'revision','',0),(5347,1,'2022-12-14 23:20:41','2022-12-14 23:20:41','','Order &ndash; dezembro 14, 2022 @ 11:20 PM','','wc-cancelled','open','closed','wc_order_7dNkcOITN6i8K','pedido-14-de-december-de-2022-as-2320','','','2022-12-15 01:44:35','2022-12-15 01:44:35','',0,'https://myymalucca.com.br/?post_type=shop_order&#038;p=5347',0,'shop_order','',1),(5348,1,'2022-12-26 23:47:31','0000-00-00 00:00:00','','Rascunho automtico','','auto-draft','open','open','','','','','2022-12-26 23:47:31','0000-00-00 00:00:00','',0,'https://myymalucca.com.br/?p=5348',0,'post','',0),(5349,1,'2022-12-27 00:25:51','2022-12-27 00:25:51','{\n    \"site_icon\": {\n        \"value\": 122,\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-12-27 00:25:51\"\n    }\n}','','','trash','closed','closed','','6720af3a-c84c-4b4d-ad30-fca5671e72ed','','','2022-12-27 00:25:51','2022-12-27 00:25:51','',0,'https://myymalucca.com.br/?p=5349',0,'customize_changeset','',0),(5350,1,'2022-12-27 00:49:23','2022-12-27 00:49:23','{\n    \"electro::electro_options[show_footer_rss_icon]\": {\n        \"value\": \"0\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-12-27 00:49:23\"\n    }\n}','','','trash','closed','closed','','497490c3-b92c-43b7-92c2-fe81287f7c5a','','','2022-12-27 00:49:23','2022-12-27 00:49:23','',0,'https://myymalucca.com.br/?p=5350',0,'cu