INSERT INTO `wp_wc_admin_notes` VALUES (1,'wc-refund-returns-page','info','en_US','Setup a Refund and Returns Policy page to boost your store\'s credibility.','We have created a sample draft Refund and Returns Policy page for you. Please have a look and update it to fit your store.','{}','unactioned','woocommerce-core','2022-12-10 01:33:08',NULL,0,'plain','',0,0,'info'),(2,'wc-admin-wc-helper-connection','info','en_US','Connect to WooCommerce.com','Connect to get important product notifications and updates.','{}','unactioned','woocommerce-admin','2022-12-10 01:33:08',NULL,0,'plain','',0,0,'info'),(3,'new_in_app_marketplace_2021','info','en_US','Customize your store with extensions','Check out our NEW Extensions tab to see our favorite extensions for customizing your store, and discover the most popular extensions in the WooCommerce Marketplace.','{}','unactioned','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(4,'wayflyer_bnpl_q4_2021','marketing','en_US','Grow your business with funding through Wayflyer','Fast, flexible financing to boost cash flow and help your business grow  one fee, no interest rates, penalties, equity, or personal guarantees. Based on your stores performance, Wayflyer provides funding and analytical insights to invest in your business.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(5,'wc_shipping_mobile_app_usps_q4_2021','marketing','en_US','Print and manage your shipping labels with WooCommerce Shipping and the WooCommerce Mobile App','Save time by printing, purchasing, refunding, and tracking shipping labels generated by <a href=\"https://woocommerce.com/woocommerce-shipping/\">WooCommerce Shipping</a>  all directly from your mobile device!','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(6,'woocommerce-services','info','en_US','WooCommerce Shipping & Tax','WooCommerce Shipping &amp; Tax helps get your store \"ready to sell\" as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(7,'your-first-product','info','en_US','Your first product','Thats huge! Youre well on your way to building a successful online store  now its time to think about how youll fulfill your orders.<br /><br />Read our shipping guide to learn best practices and options for putting together your shipping strategy. And for WooCommerce stores in the United States, you can print discounted shipping labels via USPS with <a href=\"https://href.li/?https://woocommerce.com/shipping\" target=\"_blank\">WooCommerce Shipping</a>.','{}','unactioned','woocommerce.com','2022-12-11 09:25:00',NULL,0,'plain','',0,0,'info'),(8,'wc-admin-optimizing-the-checkout-flow','info','en_US','Optimizing the checkout flow','Its crucial to get your stores checkout as smooth as possible to avoid losing sales. Lets take a look at how you can optimize the checkout experience for your shoppers.','{}','unactioned','woocommerce.com','2022-12-13 03:08:19',NULL,0,'plain','',0,0,'info'),(9,'wc-payments-qualitative-feedback','info','en_US','WooCommerce Payments setup - let us know what you think','Congrats on enabling WooCommerce Payments for your store. Please share your feedback in this 2 minute survey to help us improve the setup process.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(10,'share-your-feedback-on-paypal','info','en_US','Share your feedback on PayPal','Share your feedback in this 2 minute survey about how we can make the process of accepting payments more useful for your store.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(11,'google_listings_and_ads_install','marketing','en_US','Drive traffic and sales with Google','Reach online shoppers to drive traffic and sales for your store by showcasing products across Google, for free or with ads.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(12,'wc-subscriptions-security-update-3-0-15','info','en_US','WooCommerce Subscriptions security update!','We recently released an important security update to WooCommerce Subscriptions. To ensure your sites data is protected, please upgrade <strong>WooCommerce Subscriptions to version 3.0.15</strong> or later.<br /><br />Click the button below to view and update to the latest Subscriptions version, or log in to <a href=\"https://woocommerce.com/my-dashboard\">WooCommerce.com Dashboard</a> and navigate to your <strong>Downloads</strong> page.<br /><br />We recommend always using the latest version of WooCommerce Subscriptions, and other software running on your site, to ensure maximum security.<br /><br />If you have any questions we are here to help  just <a href=\"https://woocommerce.com/my-account/create-a-ticket/\">open a ticket</a>.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(13,'woocommerce-core-update-5-4-0','info','en_US','Update to WooCommerce 5.4.1 now','WooCommerce 5.4.1 addresses a checkout issue discovered in WooCommerce 5.4. We recommend upgrading to WooCommerce 5.4.1 as soon as possible.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(14,'wcpay-promo-2020-11','marketing','en_US','wcpay-promo-2020-11','wcpay-promo-2020-11','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(15,'wcpay-promo-2020-12','marketing','en_US','wcpay-promo-2020-12','wcpay-promo-2020-12','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(16,'ppxo-pps-upgrade-paypal-payments-1','info','en_US','Get the latest PayPal extension for WooCommerce','Heads up! Theres a new PayPal on the block!<br /><br />Now is a great time to upgrade to our latest <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">PayPal extension</a> to continue to receive support and updates with PayPal.<br /><br />Get access to a full suite of PayPal payment methods, extensive currency and country coverage, and pay later options with the all-new PayPal extension for WooCommerce.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(17,'ppxo-pps-upgrade-paypal-payments-2','info','en_US','Upgrade your PayPal experience!','Get access to a full suite of PayPal payment methods, extensive currency and country coverage, offer subscription and recurring payments, and the new PayPal pay later options.<br /><br />Start using our <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">latest PayPal today</a> to continue to receive support and updates.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(18,'woocommerce-core-sqli-july-2021-need-to-update','update','en_US','Action required: Critical vulnerabilities in WooCommerce','In response to a critical vulnerability identified on July 13, 2021, we are working with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br />Our investigation into this vulnerability is ongoing, but <strong>we wanted to let you know now about the importance of updating immediately</strong>.<br /><br />For more information on which actions you should take, as well as answers to FAQs, please urgently review our blog post detailing this issue.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(19,'woocommerce-blocks-sqli-july-2021-need-to-update','update','en_US','Action required: Critical vulnerabilities in WooCommerce Blocks','In response to a critical vulnerability identified on July 13, 2021, we are working with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br />Our investigation into this vulnerability is ongoing, but <strong>we wanted to let you know now about the importance of updating immediately</strong>.<br /><br />For more information on which actions you should take, as well as answers to FAQs, please urgently review our blog post detailing this issue.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(20,'woocommerce-core-sqli-july-2021-store-patched','update','en_US','Solved: Critical vulnerabilities patched in WooCommerce','In response to a critical vulnerability identified on July 13, 2021, we worked with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br /><strong>Your store has been updated to the latest secure version(s)</strong>. For more information and answers to FAQs, please review our blog post detailing this issue.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(21,'woocommerce-blocks-sqli-july-2021-store-patched','update','en_US','Solved: Critical vulnerabilities patched in WooCommerce Blocks','In response to a critical vulnerability identified on July 13, 2021, we worked with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br /><strong>Your store has been updated to the latest secure version(s)</strong>. For more information and answers to FAQs, please review our blog post detailing this issue.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(22,'habit-moment-survey','marketing','en_US','Were all ears! Share your experience so far with WooCommerce','Wed love your input to shape the future of WooCommerce together. Feel free to share any feedback, ideas or suggestions that you have.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(23,'ecomm-wc-navigation-survey','info','en_US','Wed like your feedback on the WooCommerce navigation','Were making improvements to the WooCommerce navigation and would love your feedback. Share your experience in this 2 minute survey.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(24,'woocommerce-core-paypal-march-2022-updated','update','en_US','Security auto-update of WooCommerce','<strong>Your store has been updated to the latest secure version of WooCommerce</strong>. We worked with WordPress to deploy PayPal Standard security updates for stores running WooCommerce (version 3.5 to 6.3). Its recommended to disable PayPal Standard, and use <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">PayPal Payments</a> to accept PayPal.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(25,'woocommerce-core-paypal-march-2022-updated-nopp','update','en_US','Security auto-update of WooCommerce','<strong>Your store has been updated to the latest secure version of WooCommerce</strong>. We worked with WordPress to deploy security updates related to PayPal Standard payment gateway for stores running WooCommerce (version 3.5 to 6.3).','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(26,'pinterest_03_2022_update','marketing','en_US','Your Pinterest for WooCommerce plugin is out of date!','Update to the latest version of Pinterest for WooCommerce to continue using this plugin and keep your store connected with Pinterest. To update, visit <strong>Plugins &gt; Installed Plugins</strong>, and click on update now under Pinterest for WooCommerce.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(27,'store_setup_survey_survey_q2_2022','survey','en_US','How is your store setup going?','Our goal is to make sure you have all the right tools to start setting up your store in the smoothest way possible.\r\nWed love to know if we hit our mark and how we can improve. To collect your thoughts, we made a 2-minute survey.','{}','unactioned','woocommerce.com','2022-12-17 04:34:56',NULL,0,'plain','',0,0,'info'),(28,'wc-admin-wisepad3','marketing','en_US','Take your business on the go in Canada with WooCommerce In-Person Payments','Quickly create new orders, accept payment in person for orders placed online, and automatically sync your inventory  no matter where your business takes you. With WooCommerce In-Person Payments and the WisePad 3 card reader, you can bring the power of your store anywhere.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(29,'woocommerce-payments-august-2022-need-to-update','update','en_US','Action required: Please update WooCommerce Payments','An updated secure version of WooCommerce Payments is available  please ensure that youre using the latest patch version. For more information on what action you need to take, please review the article below.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(30,'woocommerce-payments-august-2022-store-patched','update','en_US','WooCommerce Payments has been automatically updated','Youre now running the latest secure version of WooCommerce Payments. Weve worked with the WordPress Plugins team to deploy a security update to stores running WooCommerce Payments (version 3.9 to 4.5). For further information, please review the article below.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(31,'woocommerce_admin_deprecation_q4_2022','info','en_US','WooCommerce Admin is part of WooCommerce!','To make sure your store continues to run smoothly, check that WooCommerce is up-to-date  at least version 6.5  and then disable the WooCommerce Admin plugin.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(32,'tiktok-targeted-q4-2022','marketing','en_US','Get $200 in ad credit from TikTok after you spend $20 on your first campaign','Reach one billion shoppers with TikTok for WooCommerce this holiday season! Sync your product catalog, capture insights, and create ad campaigns right from your dashboard. Connect your store today to unlock this limited time offer! <a href=\"https://ads.tiktok.com/help/article?aid=10011326\">Terms &amp; conditions apply</a>.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(33,'paypal_paylater_g3_q4_22','marketing','en_US','Turn browsers into buyers with Pay Later','Add PayPal at checkout, plus give customers a buy now, pay later option from the name they trust. With Pay in 4 &amp; Pay Monthly, available in PayPal Payments, you get paid up front while letting customers spread their payments over time. Boost your average order value and convert more sales  at no extra cost to you.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(34,'paypal_paylater_g2_q4_22','marketing','en_US','Upgrade to PayPal Payments to offer Pay Later at checkout','PayPal Pay Later is included in PayPal Payments at no additional cost to you. Customers can spread their payments over time while you get paid up front. \r\nTheres never been a better time to upgrade your PayPal plugin. Simply download it and connect with a PayPal Business account.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(35,'google_listings_ads_custom_attribute_mapping_q4_2022','marketing','en_US','Our latest improvement to the Google Listings & Ads extension: Attribute Mapping','You spoke, we listened. This new feature enables you to easily upload your products, customize your product attributes in one place, and target shoppers with more relevant ads. Extend how far your ad dollars go with each campaign.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(36,'wc-admin-manualauthcapture','marketing','en_US','Miss fewer manual payments in WooCommerce Payments','Using WooCommerce Payments to manually authorize and capture payments? Weve introduced a simplified and more efficient process, so you can miss fewer payments and continue to grow your revenue.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(37,'apple_pay_square_q422','marketing','en_US','Grow your business with Apple Pay','Start boosting your online conversions today with Apple Pay  shoppers can safely complete a purchase with a touch or a glance and are more likely to come back. Enable Apple Pay with Square by selecting  Settings &gt; Payments &gt; Square.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(38,'apple_pay_wcpay_q422','marketing','en_US','Grow your business with Apple Pay','Start boosting your online conversions today with Apple Pay  shoppers can safely complete a purchase with a touch or a glance and are more likely to come back. Confirm Apple Pay is enabled by selecting Payments &gt; Settings and making sure Enable express checkouts is checked.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(39,'meta-hasFB-dec-q4-2022','marketing','en_US','Power up your Facebook ad strategy','Did you know that new privacy policies may be decreasing the effectiveness of your Facebook ads? Get back on track with Metas Conversion API. It creates a direct connection between the marketing data from your store and Meta, helping you more accurately track, attribute and improve your Facebook marketing performance.','{}','pending','woocommerce.com','2022-12-10 01:33:10',NULL,0,'plain','',0,0,'info'),(40,'wc-admin-test-checkout','info','en_US','No se esquea de testar a sua finalizao de compra','Certifique-se de que a sua finalizao de compra esteja funcionando corretamente antes de lanar sua loja. Passe por todo o processo de finalizao: desde adicionar um produto ao carrinho, escolher um local de entrega e fazer um pagamento.','{}','unactioned','woocommerce-admin','2022-12-10 02:49:38',NULL,0,'plain','',0,0,'info'),(41,'wc-admin-choosing-a-theme','marketing','en_US','Escolhendo um tema?','Confira os temas compatveis com o WooCommerce e escolha um alinhado com sua marca e necessidades de negcios.','{}','unactioned','woocommerce-admin','2022-12-11 09:25:00',NULL,0,'plain','',0,0,'info'),(42,'wc-admin-customizing-product-catalog','info','en_US','Como personalizar seu catlogo do produtos','Voc deseja que seu catlogo de produtos e imagens tenham uma tima aparncia e se alinhem  sua marca. Este guia fornecer todas as dicas necessrias para que seus produtos fiquem timos em sua loja.','{}','unactioned','woocommerce-admin','2022-12-11 09:25:00',NULL,0,'plain','',0,0,'info'),(44,'wc-admin-launch-checklist','info','en_US','Pronto para lanar sua loja?','Para garantir que voc nunca fique com aquela sensao de \"o que eu esqueci\", reunimos uma lista com tudo que  essencial para voc verificar antes do lanamento.','{}','unactioned','woocommerce-admin','2022-12-11 09:25:00',NULL,0,'plain','',0,0,'info'),(46,'wc-admin-mobile-app','info','en_US','Instale o aplicativo Woo','Instale o aplicativo do WooCommerce para gerenciar pedidos, receber notificaes de vendas e visualizar as principais mtricas, onde quer que voc esteja.','{}','unactioned','woocommerce-admin','2022-12-12 11:28:18',NULL,0,'plain','',0,0,'info'),(47,'wc-admin-online-clothing-store','info','en_US','Inicie sua loja de roupas online','Iniciar um site de moda  empolgante, mas tambm pode parecer esmagador. Neste artigo, orientaremos voc no processo de configurao, ensinaremos a criar listas bem-sucedidas de produtos e mostraremos como comercializar para seu pblico-alvo ideal.','{}','unactioned','woocommerce-admin','2022-12-12 11:28:19',NULL,0,'plain','',0,0,'info'),(48,'meta-noFB-dec-q4-2022','marketing','en_US','Create highly targeted Facebook ads with Facebook for WooCommerce','Sync your product catalog to create Facebook ads and track their performance  all from within your WooCommerce dashboard. With improved tracking signals and speed, plus more accurate tracking with the introduction of Metas Conversion API, youll have all the tools you need to run effective ad campaigns.','{}','unactioned','woocommerce.com','2022-12-12 11:28:19',NULL,0,'plain','',0,0,'info'),(49,'wc-admin-new-sales-record','info','en_US','Novo recorde de vendas!','Oba! dezembro 14, 2022 foi seu dia recorde de vendas! A venda lquida foi de R$3.998,00 batendo seu recorde anterior de R$750,00 definido em dezembro 10, 2022.','{\"old_record_date\":\"2022-12-10\",\"old_record_amt\":750,\"new_record_date\":\"2022-12-14\",\"new_record_amt\":3998}','unactioned','woocommerce-admin','2022-12-15 01:44:35',NULL,0,'plain','',0,0,'info'),(51,'wc-admin-usage-tracking-opt-in','info','en_US','Ajude o WooCommerce a melhorar ativando o rastreamento de uso.','A coleta de dados de uso nos permite melhorar o WooCommerce. Sua loja ser considerada  medida que avaliarmos novos recursos, julgarmos a qualidade de uma atualizao ou determinarmos se uma melhoria faz sentido. Voc sempre pode visitar as <a href=\"https://myymalucca.com.br/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Configuraes</a> e optar por parar de compartilhar dados. <a href=\"https://woocommerce.com/usage-tracking?utm_medium=product\" target=\"_blank\">Saiba mais</a> sobre quais dados coletamos.','{}','unactioned','woocommerce-admin','2022-12-17 04:34:55',NULL,0,'plain','',0,0,'info'),(52,'wc-admin-customize-store-with-blocks','info','en_US','Personalize sua loja online com os blocos do WooCommerce','Com nossos blocos, voc pode selecionar e exibir produtos, categorias, filtros e mais praticamente em qualquer lugar do seu site, no  necessrio usar shortcodes e nem editar linhas de cdigo. Saiba mais sobre como usar cada um deles.','{}','unactioned','woocommerce-admin','2022-12-24 12:07:34',NULL,0,'plain','',0,0,'info'),(53,'wc-update-db-reminder','update','en_US','Atualizao do banco de dados WooCommerce concluda','A atualizao do WooCommerce est concluda. Obrigado por atualizar para a ltima verso!','{}','actioned','woocommerce-core','2022-12-26 23:57:54',NULL,0,'plain','',0,0,'info');
